
Nuclear DNA was extracted and subjected to unbiased, whole-genome bisulfite sequencing (BS-seq) using the Illumina Genome Analyzer.  In total, 103.5 Gbp of paired-end sequence data were generated.  Of these, 70.4 Gbp (68%) were successfully aligned to either strand of the YH genome with an average mismatch rate of 1.3%, resulting in an average sequencing depth of 12.3-fold per DNA strand or a 24.7-fold overall depth.  Of the 18,962,679 CpGs present in the unique haploid part (2.21 Gb) of the YH reference genome sequence, approximately 99.86% were covered by at least one unambiguously mapped read of quality score >14 on either strand, and 92.62% were unambiguously covered on both strands.', 114890375168, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100014/', 'Published', 'GigaDBUploadForm_YHMethylome.xls', 'e4371bc4687e4052a3b03962d7359066', '2011/11/12', '2012/3/28', 1 );
